// MainContent.js
import React from 'react';

function Greeting() {
  return (
    <main>
      <div className="greeting">
        <h1>Wishing you a year full of financial securities.</h1>
        <h2>Happy Financial New Year</h2>
        <p>Business Name</p>
      </div>
      <div className="illustration">
        <img src="https://td.doubleclick.net/td/ga/rul?tid=G-NC4K485YTK&gacid=1819814709.1711523708&gtm=45je43r0v888863283za200&dma=0&gcd=13l3l3l3l1&npa=0&pscdl=noapi&aip=1&fledge=1&z=1967336186" alt="Financial " />
      </div>
    </main>
  );
}

export default Greeting;
